import React, { useState, useContext } from 'react';
import { Link, useNavigate } from 'react-router-dom';
import StoreContext from '../components/Store/Context';
import logoSimples from "../img/logoSimples.png";
/*
import logo from "../img/logo.png";

import Encomendas from '../pages/Encomendas';
import RecursosHumanos from '../pages/RecursosHumanos';
import VendasRealizadas from '../pages/VendasRealizadas';
import PrateleiraseEstoque from '../pages/EstoqueePrateleiras'
import Relatorios from '../pages/Relatorios'
import Departamento from '../pages/Departamento'
import JornadadeTrabalho from '../pages/JornadadeTrabalho'
*/

function Sidebar (userData) {
    const navigate = useNavigate();
	const { setToken, token } = useContext(StoreContext);

    return (
        <>
	<div class="sidenav">
        <img
              alt=""
              src={logoSimples}
              width="30"
              height="30"
              className="d-inline-block align-top"
              />{' '}
              SuperManager
		<div class="w-full px-2">
			<div class="flex flex-col items-center w-full mt-3 border-t border-gray-300">
				<a class="flex items-center w-full h-12 px-3 mt-2 rounded hover:bg-gray-300" href="#">
					<span class="ml-2 text-sm font-medium" onClick={(event) => navigate("JornadadeTrabalho",  { replace: false }, {state: {userData: userData}})}>Jornada de Trabalho</span>
				</a>
				<a class="flex items-center w-full h-12 px-3 mt-2 rounded hover:bg-gray-300" href="#">
			
					<span class="ml-2 text-sm font-medium"onClick={(event) => navigate("RecursosHumanos",  { replace: false }, {state: {userData: userData}})}>Recursos Humanos</span>
				</a>{ token == 3 || token == 1 ?
					<a class="flex items-center w-full h-12 px-3 mt-2 bg-gray-300 rounded" href="#">
				
					<span class="ml-2 text-sm font-medium" onClick={(event) => navigate("VendasRealizadas",  { replace: false }, {state: {userData: userData}})}>Vendas</span>
				</a>
				: ''}
				
				{token == 2 || token == 1 ? <a class="flex items-center w-full h-12 px-3 mt-2 rounded hover:bg-gray-300" href="#">
			
					<span class="ml-2 text-sm font-medium" onClick={(event) => navigate("Encomendas",  { replace: false }, {state: {userData: userData}})}>Encomendas</span>
				</a> : ''}
			</div>
			<div class="flex flex-col items-center w-full mt-2 border-t border-gray-300">
				{ StoreContext.token == 1 ? <a class="flex items-center w-full h-12 px-3 mt-2 rounded hover:bg-gray-300" href="#">
					
					<span class="ml-2 text-sm font-medium"onClick={(event) => navigate("Relatorios",  { replace: false }, {state: {userData: userData}})}>Relatórios</span>
				</a> : ''}
				{StoreContext.token == 1 ? <a class="flex items-center w-full h-12 px-3 mt-2 rounded hover:bg-gray-300" href="#">
					
					<span class="ml-2 text-sm font-medium"onClick={(event) => navigate("Departamento",  { replace: false }, {state: {userData: userData}})}>Funcionários</span>
				</a>: ''}
				<a class="relative flex items-center w-full h-12 px-3 mt-2 rounded hover:bg-gray-300" href="#">
					<span class="ml-2 text-sm font-medium">Messages</span>
					<span class="absolute top-0 left-0 w-2 h-2 mt-2 ml-2 bg-indigo-500 rounded-full"></span>
				</a>
			</div>
		</div>
		<a class="flex items-center justify-center w-full h-16 mt-auto bg-gray-200 hover:bg-gray-300" href="#">
			<svg class="w-6 h-6 stroke-current" xmlns="http://www.w3.org/2000/svg" fill="none" viewBox="0 0 24 24" stroke="currentColor">
				<path stroke-linecap="round" stroke-linejoin="round" stroke-width="2" d="M5.121 17.804A13.937 13.937 0 0112 16c2.5 0 4.847.655 6.879 1.804M15 10a3 3 0 11-6 0 3 3 0 016 0zm6 2a9 9 0 11-18 0 9 9 0 0118 0z" />
			</svg>
			<span class="ml-2 text-sm font-medium"onClick={(event) => navigate("Usuario",  { replace: false }, {state: {userData: userData}})}>Usuário</span>
		</a>
	</div>

  
      </>
      );
};



export default Sidebar
